import React, { Component } from "react";
import UserService from "../services/user.service";

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {
    return (
      <div>
        <header className="masthead">
          <div className="container position-relative">
            <div className="row justify-content-center">
              <div className="col-xl-6">
                <div className="text-center text-white">
                  <h1 className="mb-5">Хочешь завести хвостатого друга?</h1>
                  <p>Мы поможем тебе!</p>
                  <form className="form-subscribe" id="contactForm" data-sb-form-api-token="API_TOKEN">
                    <div className="row">
                      <div className="col">
                        <input className="form-control form-control-lg" id="emailAddress" type="email" placeholder="Почта" data-sb-validations="required,email" />
                        <div className="invalid-feedback text-white" data-sb-feedback="emailAddress:required">Нужно ввести почту</div>
                        <div className="invalid-feedback text-white" data-sb-feedback="emailAddress:email">Вы ввели некорректную почту</div>
                      </div>
                      <div className="col-auto">
                        <button className="btn btn-success btn-lg disabled" id="submitButton" type="submit">Отправить</button>
                      </div>
                    </div>
                    <div className="d-none" id="submitSuccessMessage">
                      <div className="text-center mb-3">
                        <div className="fw-bolder">Форма успешно отправлена!</div>
                      </div>
                    </div>
                    <div className="d-none" id="submitErrorMessage"><div className="text-center text-danger mb-3">Произошла ошибка при отправке</div></div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </header>
        {/* Other sections */}
      </div>
    );
  }
}
